import React from 'react';
import { IErrors } from '../../types';

const ListErrors = ({ errors }: { errors: IErrors }) => {
  return (
    <ul className="error-messages">
      {Object.entries(errors).map(([key, keyErrors], index) =>
        keyErrors.map((error) => (
          <li key={index}>
            {key} {error}
          </li>
        )),
      )}
    </ul>
  );
}

export default ListErrors;
